import React from 'react';
import './Playlist.css';

export class Playlist extends React.Component {
    render () {
        return (

            <div class="SearchBar">
                <input placeholder="Enter A Song, Album, or Artist" />
                <button class="SearchButton">SEARCH</button>
            </div>
        );
    }
}
